desc:
RSS News - это скрипт для создания новостных сайтов. Скрипт (агрегатор) делает импорт новостей из RSS-источников и сохраняет их с изображениями (если они найдены) в базу данных.

Особенности RSS News:

- Адаптивный дизайн с использованием Bootstrap 3;
- Удобная панель управления;
- Неограниченные категории;
- Неограниченные источники RSS;
- Неограниченные страницы;
- Импорт новостей из любого типа канала (RSS или Atom);
- Импорт новостей вручную и автоматически;
- Smarty Templates Engine для большей гибкости в редактировании тем;
- Места для рекламных блоков;
- LazyLoad для изображения;
- Файлы Sitemap (категории, новости);
- Disqus комментарии;
- Поддержка Open Graph для изображении;
- RTL поддержка;
- и другое...

name:
Order Master 2







Мощный автономный скрипт для оформления заказов и организации партнёрской программы

Order Master 2 - это мощный и функциональный скрипт (программа), предназначенный для установки на свой сайт форм оформления заказов и приёма оплаты за товары, услуги или информационные продукты, для создания рекламных сайтов-одностраничников, для организации собственной партнёрской программы, а также для использования системы поддержки и других функций.



Скрипт "Order Master 2" (OM2) разработан с использованием новых современных технологий в 2014 году, а серия предыдущих разработок и версий активно развивается уже более 8 лет. Более 1000 Интернет-предпринимателей уже сделали выбор в пользу одной из версий Order Master.

Если Вы занимаетесь информационным бизнесом или же продажей физических товаров через собственные сайты, рассылки, блоги или одностраничные сайты - Order Master 2 будет для Вас полезным и нужным инструментом в работе.



Вы можете установить этот скрипт на Ваш сайт для того чтобы:

- принимать заказы с Вашего сайта на самые разные продукты - инфо-товары, электронные книги, физические товары;

- работать с заказами - управлять их статусами, отмечать обзвоны, номера почтовых отправлений и др.;

- организовать партнёрскую программу и выплачивать вознаграждения Вашим партнёрам;

- организовать авторскую панель и выплачивать вознаграждения соавторам;

- выпускать "закрытые зоны" с ежемесячной абонплатой;

- использовать тикетную систему для поддержки Ваших клиентов;

- использовать автоматическую доставку цифровых товаров, PIN-кодов для Ваших клиентов;

- использовать различные системы скидок, апселлы, дополнительные рассылки и многое другое для увеличения продаж.

Это лишь краткий список возможностей, которые есть в скрипте Order Master 2.



