Пакет готовых скриптов с анимациями на GSAP





​GSAP - это анимационная платформа, созданная в свое время для Action Script, теперь портирована и на JS.
Умеет анимировать свойства абсолютно любых объектов, удобный в использовании, легкий в весе и, что самое главное, очень шустрый.
Тест скорости работы.

Так же нужно отметить:

кроссбраузерность (работает во всех браузерах начиная от ie6);
абсолютную независимость от других фреймворков;
возможность организации и управления timeline - компоновка анимаций в единное целое на усмотрение разработчика;
небольшой вес (к примеру, версия TweenLite.min весит на сегодняшний день 21kb);
удобный и интуитивно понятный API, отличная документация;
подключаемые плагины (кривые Безье, плагин для работы с Raphael, плагин cssRules);
...а так же понятный и доступный туториал.

