Скрипт автоматизации действий в VK и OK

Будулай Про: Автоматизированная система продвижения
Набор скриптов представляет собой веб-панель, позволяющую управлять пользовательскими аккаунтами и сообществами в социальной сети вКонтакте и пользовательскими аккаунтами в социальной сети Одноклассники.

Для работы требуется: хостинг с cronjob  и версией php 5.5/5.6.
Функционал/ вк анкеты:

Мониторинг состояния аккaунтов:
- отображение аватара анкеты;
- отображения статуса онлайн/оффлайн;
- отображение домена (из поля "вебсайт" в анкете) и статуса ссылки в вк - забанена или нет (проверка на бан каждые полчаса);
- для каждой анкеты - возможность просмотра последних 20 диалогов/бесед - и 20 текстовых/фото сообщений в диалоге/беседе, возможность отвечать в переписке из веб-интерфейса;
- отображение количества друзей, подписчиков, сообществ (отдельно - количество администрируемых сообществ) для каждой анкеты (обновление каждые 6 часов).


Операции с друзьями в автоматическом режиме:
- регулярное одобрение входящих заявок в друзья (одобрение всех заявок, одобрение заявок только от мужчин или только от женщин);
- регулярная отмена исходящих заявок в друзья (возможно настроить - отменять более старые заявки и не трогать более новые высланные заявки);
- удаление общих друзей между анкетами;
- удаление друзей по полу;
- удаление друзей по дате посещения;
- удаление собак из друзей;
- чистка подписчиков от собак;
- чистка чёрного списка;

Поддержка прокси для вышеописанных функций (HTTP или SOCKS5 с авторизацией по логину и паролю).

Активность на анкетах в автоматическом режиме:

- вечный онлайн анкет;

- постинг текстов из базы на стену анкет из базы;

- автоматический репост постов из продвигаемых сообществ вКонтакте на стену анкет из базы;

- постинг фото и видео материалов на стену анкет из базы - вступление анкетами в сообщества по списку;

- одобрение входящих приглашений в группы и на встречи от друзей;

- "свои паблики всегда на видном месте в анете";

- лaйки постов в сообществе случайными анкетами из массива

- лaйкинг новых постов в сообществе указанными анкетами; - лайкинг новых сообщений в обсуждениях сообщества.



Поддержка прокси для вышеописанных функций (HTTP или SOCKS5 с авторизацией по логину и паролю).

- загрузка фотографий из соответствующей папки на хостинге, на стену анкеты (для каждой анкеты - свои фото) (на данный момент без прокси).

Функционал вк сообщества:
- одобрение заявок в закрытые группы;

- отмена инвайтов в сообществах.

- косметическая и полная (поэтапная) очистка сообществ от "собак;

- удаление комментариев под закреплённой новостью в сообществах (всех или от "не-участников");

- модерация открытой стены в группах по критериям участник/не участник, наличие ссылки в сообщении, по списку стоп-слов и по списку стоп-телефонных номеров;

- модерация предлагаемых новостей (возможность отклонения новостей если предложивший не является участником сообщества, возможность отклонения новостей если в тексте новости отсутствует обязательное слово);

- автопостинг по расписанию в свои сообщества фото и видео записей (фото и видео должны быть предварительно загружены в вк);

- рекламные посты, репосты и взаимные репосты между своими сообществами в автоматическом режиме (с возможностью удаления репоста через заданный промежуток времени).



Поддержка прокси для вышеописанных функций (HTTP или SOCKS5 с авторизацией по логину и паролю).



- единичные рекламные репосты в заданное время (без прокси);

- статистика посещаемости сообществ на одной странице (без прокси).


Функционал одноклассники анкеты:

- вечный онлайн анкет;

- отображение аватара анкеты и её статуса (онлайн/оффлайн);

- отображение наличия пользовательского статуса в анкете (при наличии внешней ссылки - отображение данной ссылки);

- одобрение входящих заявок в друзья на анкетах (по 20 каждый час);

 - отображение количества друзей на анкетах, динамики увеличения количества друзей с момента добавления анкеты в монитор;

- возможность репоста указанными анкетами определённой темы из сообщества (указываем ссылку на тему и номера анкет).

ПРОЧЕЕ

- прокси-чекер HTTP и SOCKS5 (с авторизацией по логину/паролю) проксей на работоспособность и анонимность;

- экспорт сообществ вконтакте, в которых состоят указанные анкеты (с фильтрацией от заблокированных и дубликатов);

- перевод списка url пользователей вконтакте в список id;

- перевод списка url сообществ вконтакте в список id;

- сортировка друзей пользователя вконтакте по дате посещения;

- сбор списка id сообществ из поиска по указанным ключевым словам.


